function TodoList(){
  const initialState = [
    {
      task: 'aaa',
      isCompleted: false
    },
    {
      task: 'bbb',
      isCompleted: false
    },
    {
      task: 'ccc',
      isCompleted: false
    },
  ]

  const [todos, setTodo] = useState(initialState);

  return(
    <div>
      <h1>ToDo List</h1>
    </div>
  )
}
